import React from 'react';
import PageWrapper from './components/PageWrapper';
import Home from './components/Pages/Home';
import {BrowserRouter as Router, Route, Link} from 'react-router-dom';

function App() {
  return (
      <Router>
        <Route 
          exact={true}
          path="/"
          render={props => (
            <PageWrapper>
              <Home {...props} />
            </PageWrapper>
          )}
        />
      </Router>
  );
}

const mapStateToProps = state => {
  return {
    auth: state.auth
  }
}

